 Joey Stone RE: PUBLIC RECORDS REQUEST of May 23, 2025, Reference # F105118-052325. Dear Joey Stone,

"On behalf of the City of Chicago Department of Finance (“DOF”), I am responding to your Freedom of Information Act (“FOIA”) sent and received by DOF on May 23, 2025, your request as written was:
 
"I am requesting records related to purchases made with consent decree funds. Purchase request forms and accompanying documentation, including memos Invoices for each purchase. Search 2020 to today.”
 
At this time, I am seeking an extension of five additional working days (Please be advised that Monday May 26, 2025, is not a working day.) from the date of receipt to respond to the request for one or more of the following reasons identified in 5 ILCS 140/3(e) of FOIA:
 
(  ) the requested records are stored in whole or in part at other locations than the office having charge of the requested records;
 
(  ) the request requires the collection of a substantial number of specified records;
 
(  ) the request is couched in categorical terms and requires an extensive search for the records responsive to it;
 
(  ) the requested records have not been located in the course of routine search and additional efforts are being made to locate them;
 
(  ) the requested records require examination and evaluation by personnel having the necessary competence and discretion to determine if they are exempt from disclosure under Section 7 of the FOIA or should be revealed only with appropriate deletions;
 
(  ) the request for records cannot be complied with by the public body within the time limits prescribed by 5 ILCS 140/3(d) without unduly burdening or interfering with the operations of the public body;
 
( X ) there is need for consultation, which shall be conducted with all practicable speed, with another public body or among two or more components of a public body having a substantial interest in the determination or in the subject matter of the request.
 
Sincerely,
 
Frank Davis
FOIA OFFICER/ASSISTANT DIRECTOR P&L
Department of Finance"
